def حساب_قوة_الحساب(f, l, v):
    try:
        f, l, v = int(f), int(l), int(v)
        score = 0
        score += min(f / 1000, 30)
        score += min(l / 5000, 30)
        score += min(v * 2, 20)
        if f > 100000 and l > 100000 and v > 30:
            score += 20
        return min(int(score), 100)
    except:
        return 0

